package project5.z01_util;

public class PageRank2 {

	private String rank;
	private String page;

	public PageRank2() {
		super();
		// TODO Auto-generated constructor stub
	}

	public PageRank2(String rank, String page) {
		super();
		this.rank = rank;
		this.page = page;
	}

	public String getRank() {
		return rank;
	}

	public void setRank(String rank) {
		this.rank = rank;
	}

	public String getPage() {
		return page;
	}

	public void setPage(String page) {
		this.page = page;
	}

}
